import org.apache.spark.streaming._
import org.apache.spark.streaming.twitter._
import org.apache.spark.sql._
import twitter4j._
import twitter4j.Status

import java.sql.Timestamp

object TwitterStreamingTaskAllCountries {

  case class Tweet(text: String, time: Timestamp, country: String, placeName: String)

  def setupLogging(): Unit = {
    import org.apache.log4j.{Level, Logger}
    val rootLogger = Logger.getRootLogger
    rootLogger.setLevel(Level.ERROR)
  }

  def mapToTweet(record: Status): Tweet = {

    val text = record.getText
    val time = new java.sql.Timestamp(record.getCreatedAt.getTime())
    val country = record.getPlace.getCountry
    val placeName = record.getPlace.getFullName
    Tweet(text, time, country, placeName)
  }

  def setupTwitter(lines:Array[String]): Unit = {

    for (line <- lines) {
      val fields = line.split(" ")
      if (fields.length == 2) {
        System.setProperty("twitter4j.oauth." + fields(0), fields(1))
      }
    }
  }

  def run() {

    val path = "hdfs://sandbox-hdp.hortonworks.com:8020/user/maria_dev/twitter/tweetPostsZeppelin"

    val lines = "hdfs://sandbox-hdp.hortonworks.com:8020/user/maria_dev/twitter/twitter.txt"

    val sparkSession = SparkSession
      .builder
      .getOrCreate()

	import sparkSession.implicits._
	
    setupTwitter(sc.textFile(lines).toLocalIterator.toArray)

    val ssc = new StreamingContext(sc, Seconds(1))

    setupLogging()

    val tweets = TwitterUtils.createStream(ssc, None)
	
    val locatedTweets = tweets.filter(status =>
      status.getPlace != null
    )

    val output = locatedTweets.map(record => {
         val text = record.getText
    val time = new java.sql.Timestamp(record.getCreatedAt.getTime())
    val country = record.getPlace.getCountry
    val placeName = record.getPlace.getFullName
    (text, time, country, placeName)
        
    })

    output.print	
	
    output.foreachRDD(rdd => {
        val df = rdd.toDF("text","time","country","placeName")
        df.write.format("parquet").mode("append").parquet(path)
    })
	

    //ssc.checkpoint("hdfs://sandbox-hdp.hortonworks.com:8020/user/maria_dev/twitter/checkpointZeppelin")
    ssc.start()
    ssc.awaitTermination()
  }

}
